def compare_distances(test_cases):
    results = []
    for (x1, y1, x2, y2) in test_cases:
        d1 = math.sqrt(x1 ** 2 + y1 ** 2)
        d2 = math.sqrt(x2 ** 2 + y2 ** 2)
